commit_message:
languages support refactor; improved Ukrainian support

* language-specific constants are moved to pymorphy2.lang;
* more analyzer units are parametrized with language constants;
* prediction prefixes are no longer compiled during dict compilation;
* a list of known prefixes for Ukrainian is added;
* a list of initial Ukrainian letters is added;
* smaller list of particles allowed after a hyphen is set for Ukrainian;
* default list of analyzer units is added for Ukrainian.

setup.py cleanup

* check for CPython instead of checking for PyPy;
* don't install fastcache for Python 3.5

improved dictionary path/language selection logic

* more tests;
* support pymorphy2==0.8 dictionaries as 'ru-old';
* fixed Ukrainian dict loading.
